import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import SignIn from './SignIn';
import SignUp from './SignUp';
import HospitalForm from './HospitalForm';
import Navbar from './Navbar';
import './App.css';

const App = () => {
    const [isSignIn, setIsSignIn] = useState(true);

    return (
        <Router>
            <div className="App">
                <Navbar setIsSignIn={setIsSignIn} />
                <Routes>
                    <Route path="/" element={<HospitalForm />} /> {/* Make Add Hospital the main page */}
                    <Route path="/signin" element={<SignIn setIsSignIn={setIsSignIn} />} />
                    <Route path="/signup" element={<SignUp setIsSignIn={setIsSignIn} />} />
                    <Route path="/about" element={<About />} />
                    <Route path="/contact" element={<Contact />} />
                </Routes>
            </div>
        </Router>
    );
};

const About = () => (
    <div className="about">
        <h2>About Us</h2>
        <p>This application helps manage hospital information efficiently.</p>
    </div>
);

const Contact = () => (
    <div className="contact">
        <h2>Contact Us</h2>
        <p>Email: support@hospitalmanagement.com</p>
        <p>Phone: +1 (555) 123-4567</p>
    </div>
);

export default App;
